import React from 'react';


class SearchBar extends React.Component {
    render(){
        return(
            <nav class="level">
                <div class="level-item">
                    <div>
                    <p class="heading">Tweets</p>
                    <p class="title">3,456</p>
                    </div>
                </div>
                <div class="level-item">
                    <div>
                    <p class="heading">Following</p>
                    <p class="title">123</p>
                    </div>
                </div>
            </nav>
        )
    }
}

export default SearchBar;
